// src/HomePage.js
import React from 'react';
import './HomePage.css'; // Assuming you have a CSS file for styling

const HomePage = ({ onOrderNow }) => {
    return (
        <div className="home-page">
            <nav className="navbar">
                <ul>
                    <li><a href="#home">Home</a></li>
                    <li><a href="#about">About Us</a></li>
                    <li><a href="#contact">Contact</a></li>
                </ul>
            </nav>
            <div className="home-content">
                <h1>Welcome to YummyRoute Our Food Ordering App</h1>
                <p>Your one-stop solution for ordering delicious food online!</p>
                <button className="order-button" onClick={onOrderNow}>Order Now</button>
            </div>
        </div>
    );
};

export default HomePage;
